template.defaults.imports.formatUrl=function(t,e){return base.ShowThumb(t,e)},template.defaults.imports.formatText=function(t){return base.UnUnicodeText(t)},template.defaults.imports.formatDistance=function(t){var t=parseFloat(t),e=parseInt(t/100);return e<9?e+1+"00米以内":parseInt(t/1e3)+1+"公里以内"},template.defaults.imports.formatTip=function(t,e,r,a){switch(t){case 0:return"喜欢了"+e+"篇";case 1:return"关注了"+r+"人";case 2:return"收藏了"+a+"篇";default:return""}};